(12, 'Perù Service Summit', 'Es el evento pionero en Latinoamérica, y una de las principales plataformas de negocios para la promoción y el comercio de contenidos y soluciones empresariales de servicios basados en conocimiento como software, Fintech, animación digital, videojuegos, diseño, marketing digital y servicios a la minería Existe herramientas como talleres dentro del Summit para aprendizaje respecto a exportaciones de servicios. Lo organiza Promperú.', '2025-10-14 10:00:00', '2025-10-18 19:00:00', 0, 0, NULL),
(14, 'SITDEF-X Salón Internacional de Tecnología', 'SITDEF PERÚ 2025 ofrece a los expositores todas las herramientas\r\ncomerciales para que su visita sea lo más exitosa posible. Le ofrecemos un\r\ncatálogo con detalles útiles, horarios especiales para ruedas y reuniones de\r\nnegocios, pabellones amplios, iluminados y muy bien señalizados, seguridad, fabricación, mantenimiento, ciberseguridad. Con los últimos avances en seguridad, tecnología,\r\nciberseguridad y prevención de desastres.\r\n50,000 visitantes nacionales e internacionales\r\n• 212 exhibidores nacionales e internacionales\r\n• 32 países representados\r\n• Lo último en tecnología y seguridad, Ingeniería, investigación,\r\nfabricación, distribución, servicios de logística, mantenimiento, etc.\r\n• 24 al 27 de abril 2025', '2025-04-24 10:00:00', '2025-04-27 18:00:00', 0, 0, NULL);
